  false,\n\t\"url\": null,\n\t\"notes\": \"The data is comprised of the records of
  individual male golden king crab (GKC) tagged at the Kodiak Laboratory. Initial
  size, shell condition and missing limbs was recorded. A record of the water temperature
  was also made. Each crab received a leg tag to provide identification. Half the
  crab also received a spaghetti identical to those applied in the field. Tagged and
  untagged crab were held in identical conditions.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
